import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props)
    this.state = {
      getEmail: false
    }
  }

  getEmail = () => {
    console.log('get email')
  }

  render() {
    return (
      <div className="App">
        <button onClick={this.getEmail} className="get_button">Get email</button>
      </div>
    );
  }
}

export default App;
